description:
The Victor Disc is an instrumental studio album by the American band Phish. The material was recorded during an impromptu jam session in New York City, the night before the band's December 2002 appearance on the Late Show with David Letterman. Recorded between the release of Round Room and Phish's return to the stage on New Year's Eve 2002 after a two-and-a-half year break, the The Victor Disc provides an intimate glimpse of the band &quot;in a stripped down, unpolished studio setting&quot;.[1]
